import React from 'react';
import Paper from '@material-ui/core/Paper';


function DataCard({ name, dataFetcher }) {

  return (
    <React.Fragment>
      <Paper>
        <h1>
          name
        </h1>
      </Paper>
    </React.Fragment>
  )
}

export default DataCard;
